import React, { useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';

const Login = () => {
  const [formData, setFormData] = useState({
    email: '',
    password: ''
  });
  const [loading, setLoading] = useState(false);
  const [message, setMessage] = useState('');
  
  const { login } = useAuth();
  const navigate = useNavigate();

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setMessage('');

    const result = await login(formData.email, formData.password);
    
    if (result.success) {
      setMessage('üéâ Login successful! Redirecting...');
      setTimeout(() => navigate('/'), 1500);
    } else {
      setMessage('‚ùå ' + result.message);
    }
    
    setLoading(false);
  };

  return (
    <div className="auth-container">
      <div className="auth-card">
        {/* Header Section */}
        <div className="auth-header">
          <div className="auth-logo">
            üé™ EventHub
          </div>
          <h2 className="auth-title">Welcome Back</h2>
          <p className="auth-subtitle">Sign in to your account to continue your event journey</p>
        </div>

        {/* Message Display */}
        {message && (
          <div className={`auth-message ${message.includes('üéâ') ? 'success' : 'error'}`}>
            {message}
          </div>
        )}

        {/* Login Form */}
        <form onSubmit={handleSubmit} className="auth-form">
          <div className="form-group">
            <div className="input-container">
              <span className="input-icon">üìß</span>
              <input
                type="email"
                name="email"
                value={formData.email}
                onChange={handleChange}
                className="form-input"
                placeholder="Enter your email address"
                required
              />
            </div>
          </div>

          <div className="form-group">
            <div className="input-container">
              <span className="input-icon">üîí</span>
              <input
                type="password"
                name="password"
                value={formData.password}
                onChange={handleChange}
                className="form-input"
                placeholder="Enter your password"
                required
              />
            </div>
          </div>

          <button 
            type="submit" 
            className={`auth-btn ${loading ? 'loading' : ''}`}
            disabled={loading}
          >
            {loading ? (
              <>
                <span className="spinner"></span>
                Signing In...
              </>
            ) : (
              'üöÄ Sign In to EventHub'
            )}
          </button>
        </form>

        {/* Divider */}
        <div className="auth-divider">
          <span>New to EventHub?</span>
        </div>

        {/* Register Link */}
        <div className="auth-footer">
          <p>
            Don't have an account?{' '}
            <Link to="/register" className="auth-link">
              Create an account here
            </Link>
          </p>
        </div>

        {/* Demo Info */}
        <div className="demo-info">
          <div className="demo-header">
            <span className="demo-icon">üí°</span>
            <strong>Demo Access</strong>
          </div>
          <p>Use any email and password to login instantly!</p>
          <div className="demo-examples">
            <span>Try: student@example.com</span>
            <span>Or: yourname@test.com</span>
          </div>
        </div>
      </div>

      {/* Background Decorations */}
      <div className="floating-icon">üé™</div>
      <div className="floating-icon">üé´</div>
      <div className="floating-icon">üìÖ</div>
    </div>
  );
};

export default Login;
